import React from "react";
import logo from "../logo.png";
import Content from "../components/Content";
import '../css/Home.css';


const Home = React.memo(() => {
    return (
        <Content>
            <img src={logo} className="App-logo" alt="logo"/>
        </Content>
    )
});

export default Home
